import '../styles/FreelancerDashboard.css';
import React, { useContext } from 'react';
import { AuthContext } from '../context/AuthContext';
import { useNavigate } from 'react-router-dom';
import { FaUser, FaSignOutAlt, FaBriefcase, FaPlusCircle, FaUserCircle } from 'react-icons/fa';

export default function FreelancerDashboard() {
  const { user, logout } = useContext(AuthContext);
  const navigate = useNavigate();

  const handleLogout = () => {
    logout();
    navigate('/login');
  };

  const userName = user?.user?.name || user?.name || 'Guest';
  const userRole = user?.user?.role || user?.role || 'Freelancer';

  return (
    <div className="dashboard-container">
      <h2 className="dashboard-title">Freelancer Dashboard</h2>
      <div className="dashboard-cards">
        <div className="dashboard-card">
          <h3>Browse Available Gigs</h3>
          <p>Explore new opportunities and find gigs that match your skills.</p>
        </div>
        <div className="dashboard-card">
          <h3>My Applications</h3>
          <p>Track your applications and see the status of each gig.</p>
        </div>
        <div className="dashboard-card" >
          <h3>Profile Settings</h3>
          <p>Update your profile, skills, and preferences anytime.</p>
        </div>
      </div>
    </div>
  );
}

